import Header from "./Header";
import Footer from "./Footer";
import { Fragment } from "react";

export default function Layout(props) {
  return (
    <Fragment>
      <Header />
      <main className="content-wrapper">{props.children}</main>
      <Footer />
    </Fragment>
  );
}
